import "../assets/css/hero.css";
import { FaLinkedin, FaGithub, FaFacebook, FaInstagram } from "react-icons/fa";

function Navbar() {
  const handleClick = (event) => {
    event.preventDefault();
    document
      .getElementById(event.target.value)
      .scrollIntoView({ behavior: "smooth", block: "start" });
  };

  const handleButtonClick = (event) => {
    const link = event.target.value;s
    window.open(link, "_blank");
  };

  return (
    <div className="navbar">
      <div className="nav-item nav-title">
        <strong>Jake Busse</strong>
      </div>
      <div className="nav-container" id="anchors">
        <button
          className="nav-item nav-link"
          value="about"
          onClick={handleClick}
        >
          About
        </button>
        <button
          className="nav-item nav-link"
          value="work"
          onClick={handleClick}
        >
          Work
        </button>
        <button
          className="nav-item nav-link"
          value="education"
          onClick={handleClick}
        >
          Education
        </button>
        <button
          className="nav-item nav-link"
          value="portfolio"
          onClick={handleClick}
        >
          Portfolio
        </button>
        <button
          className="nav-item nav-link"
          value="contact"
          onClick={handleClick}
        >
          Contact
        </button>
      </div>
      <div className="nav-container" id="socials">
        <button
          className="nav-item nav-button"
          value="https://linkedin.com/in/jakebusse"
          onClick={handleButtonClick}
        >
          <FaLinkedin />
        </button>
        <button
          className="nav-item nav-button"
          value="https://github.com/jakebusse"
          onClick={handleButtonClick}
        >
          <FaGithub />
        </button>
        <button
          className="nav-item nav-button"
          value="https://instagram.com/jakerbusse"
          onClick={handleButtonClick}
        >
          <FaInstagram />
        </button>
      </div>
    </div>
  );
}

export default Navbar;
